svg.script:
	document.addEventListener("mouseover", function(evt) {
		var n = document.getElementById('countryName');
		var element = evt.srcElement || evt.target;
		if (element)
			n.textContent = element.id;

		if(element)
			element.setAttribute('style', 'fill:orange');

	}, false);

	document.addEventListener("mouseout", function(evt) {
		var element = evt.srcElement || evt.target;
		if (element)
			element.setAttribute('style', '');
	}, false);

	var x = 250, y = 580, scaleFactor = 0.65;

	document.addEventListener("click", function(evt) {
		scaleFactor += 0.75;
		x -= 120;
		y += 590;
		document.getElementById('worldmap').setAttribute('transform', 'translate('+ x +','+ y +') scale(' + scaleFactor + ')');
	}, false);
